import React from 'react';

class Header extends React.Component {
  constructor(props){
    super(props);
  }
  render () {
    return (
    <div className=" container container-fluid row-sm bg-info">
      <h1 className="logo col-sm-auto">Logo</h1>
      <div className="menu container container-fluid row-xs col-sm-auto">
        <a className="row m-2" href="#">Home</a>
        <a className="row m-2" href="#">Products</a>
        <a className="row m-2" href="#">Company</a>
      </div>
      <button type="button" className="btn border-primary col-sm-auto">Hire Me</button>
    </div>
    );
  }
}

export { Header }
